In the (admittedly rare) case that the toString() method is deprecated the code will only mark calls as such when used explicitly, for example:

public class NonString
{
	/** @deprecated */
	@Override @Deprecated
	public String toString()
	{return "N/A";}

	public static void main(String[] param)
	{
		NonString a = new NonString();
		System.out.println("Explicit: " + a.toString());	// 1
		System.out.println("Implicit: " + a);			// 2
	}
}

In (1) the "toString" is struck through, but there is no such mark when toString() is implicitly called in (2).  I might expect 'a' to be struck through in the second case since it is this which invokes the toString() method.

(NB. Is there any particulr reason why use of deprecated code in non-deprecated methods such as in (1) and (2) isn't flagged as a warning in the margin/Problems view even with Deprecated API compiler setting set to Warning?)

The generate hashCode/equals wizard generates code like this:

public class Test {

	private int foo;

	private int bar;

	public int hashCode() {
		final int prime = 31;
		int result = 1;
		result = prime * result + bar;
		result = prime * result + foo;
		return result;
	}

	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (obj == null)
			return false;
		if (getClass() != obj.getClass())
			return false;
		final Test other = (Test) obj;
		if (bar != other.bar)
			return false;
		if (foo != other.foo)
			return false;
		return true;
	}

}

According to http://java.sun.com/docs/codeconv/html/CodeConventions.doc6.html#449, it is a bad practice to avoid the {} on if statements.
